import React from "react"

export default() =>

<div style={{display: "grid"}}>
    <input
      type = "email"
      name = "email"
      id = "ed_email"
      placeholder = "Email"/>

    <input
      type = "password"
      name = "password"
      id = "ed_password"
      placeholder = "Password"/>

      <div className="regist"><a href=''>Don't have account? Register Here!</a></div>
      <button className="login">Login</button>
<style jsx global>{`
    body {
        background: #FFFFF;
        font-family: 'Open Sans', sans-serif;
    }

    div {
        margin: 0 auto;
        display: block;
    }

    .regist{
        margin: 0 auto;
        font-size: 12px;
        position: relative;
        right: 0;
    }

    #ed_email{
        width: 50%;
        position: relative;
        margin-top: 20%;
        display: block;
        font-size: 20px;
        border: none;
        border-bottom: 2px inset #000000;
        padding: 10px 10px;
    }
`}</style>
</div>
